import { Route } from "react-router-dom";
import Welcome from "./pages/Welcome";
import Product from "./pages/Product";
function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      <Route path='/Welcome'  element={<Welcome/>}></Route>
      <Route></Route>
    </div>
  );
}

export default App;
